import React, { Component } from "react";
import "./Message.scss"

class Message extends Component {
    constructor(props) {
        super(props)
        let temp = JSON.parse(this.props.message)
        console.log(temp)
        this.state = {
            message: temp,
        }
    }

    render() {
        return (
            <div className="Message">
                <p>{this.state.message.from}</p>
                {this.state.message.body}
            </div>
        )
    }
}

export default Message
